import React from 'react';
import LoadPage from './views/LoadPage';
import Header from './components/layout/Header';
import Logo from './components/Logo'
import Sand from './assets/vehicles/sandcrawler.png'
import Button from './components/Button';
import Card from './components/Card';
import CardCheckout from './components/CardCheckout';
import PaymentType from './components/PaymentType';

function App() {
  return (
    <div className="w-full h-screen flex flex-col justify-center items-center pb-72" >
      <CardCheckout img={Sand}
                    alt={'Car'}
                    name={'Sand Crawler'}
                    company={'Trash Nomades'}
                    price={1400000} />
                    <div className="mt-12"></div>
      <PaymentType />
      <div className="mt-6"></div>

      <div className="flex flex-col space-y-1">
        <label className="text-sm text-gray-400">Nome:</label>
        <input placeholder="Nome" className="text-lg border-b-2 border-blue-800 h-12 outline-none px-4 rounded-br-2xl w-80 hover:shadow-xl" type="text" />
      </div>
    </div>
  );
}

export default App;
